import axios from "axios";

class Results extends Component {
    constructor(props) {
		super(props)
		this.state = {
			result: ''
		}
		this.componentDidMount = this.componentDidMount.bind(this);
	}

    getSub() {
		const subResponse = axios.get("http://127.0.0.1:8000/api/subs/?format=json&subname="
		.concat((this.props.subname).toString())
			).then( 
        response => { 
			console.log(this.props.subname)
            var result = response.data; 
            this.setState({ result: result })
            }, 
            (error) => { 
            {alert(error)}; 
            } 
    	); 
	}
	
	componentDidMount() {
		this.props.showResult ? this.getSub() : null
	}

	render() {
